/**
 * @param {string} s
 * @param {number} k
 * @return {boolean}
 */
var hasAllCodes = function (s, k) {
    const allCodes = new Set();
    let count = s.length - k + 1;
    const needed = Math.pow(2, k);
    if (count < needed) return false;
    for (let i = 0; i <= s.length - k; i++) {
        allCodes.add(s.substring(i, i + k));
        count--;
        if (allCodes.size === needed) return true;
        if (count + allCodes.size < needed) return false;
    };
};

